import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import styled from "styled-components";
import LocationOnIcon from '@material-ui/icons/LocationOn';
import PhoneIcon from '@material-ui/icons/Phone';
import MailIcon from '@material-ui/icons/Mail';


const MainDiv = styled.div`

`;

const MainCard = styled(Card)`
margin-bottom:30px;
margin-left:220px;
// margin-right:400px;
margin-top:30px;
float:left;
width:500px;
`;

const CardContentDiv = styled(CardContent)`
    background-color:#f1f1f1;
`;

const CardContentDiv1 = styled(CardContent)`
    background-color:#808080;
`;

const TypographyDiv = styled(Typography)`

`;

const MainCard2 = styled(Card)`
margin-bottom:30px;
// margin-left:400px;
margin-right:220px;
margin-top:30px;
width:500px;
float:right;
`

const TextDiv = styled.h2`

`

const LocationOnIconDiv = styled(LocationOnIcon)`
float:left;
margin-top:5px;
margin
`;


function ContactPage(props) {

    return (
        <MainDiv>
            <MainCard >
                <CardContentDiv>
                    <TypographyDiv>
                        <LocationOnIconDiv /><TextDiv>Address</TextDiv>
                    </TypographyDiv>
                    <TypographyDiv>
                        ssss
                </TypographyDiv>
                    <TypographyDiv>
                        adjective
                </TypographyDiv>
                    <TypographyDiv>
                        well meaning and kindly.
                     <br />
                        {'"a benevolent smile"'}
                    </TypographyDiv>
                </CardContentDiv>
            </MainCard>

            <MainCard2 >
                <CardContentDiv1>
                    <TypographyDiv>
                        <TextDiv>Send Me A Message</TextDiv>
                    </TypographyDiv>
                    <TypographyDiv>
                        ssss
                </TypographyDiv>
                    <TypographyDiv>
                        adjective
                </TypographyDiv>
                    <TypographyDiv>
                        well meaning and kindly.
                     <br />
                        {'"a benevolent smile"'}
                    </TypographyDiv>
                </CardContentDiv1>
            </MainCard2>
        </MainDiv>
    );
}

export default ContactPage;
